import React from 'react';

const Header = () => {
  return (
    <div className="card">
      <div className="Header">
        <div className="col-sm-4 LeftMenu">
          COGETER
        </div>
        <div className="col-sm-3 CenterMenu">
          kjnkjhnkjh
        </div>
        <div className="col-sm-4 text-right">
          {/* <div className="row"> */}
            <span className="Menu">
              Home
            </span>
            <span className="Menu">
              Sessions
            </span>
            <span className="Menu">
              Chat
            </span>
            <span className="Menu">
              Support
            </span>
          {/* </div> */}
        </div>
      </div>
    </div>
  );
};

export default Header;
